// yandex map
function yandexMap(mapId, mapOptions) {
	var map;
	
	this.mapConstructor = function() {
		map = new ymaps.Map(mapId, mapOptions);
		map.behaviors.disable('scrollZoom');

		return map;
	}();
	
	this.addMarksToMap = function(marksList) {
		var currentPlacemarks = marksList.map(function (value) {
			return new ymaps.Placemark(value.center, {
				balloonContent: '<p>' + value.title + '<br>' + value.balloonContent + '</p>',
				hintContent: value.hintContent,
				id: value.id
			}, value.markOption);
		});

		return ymaps.geoQuery(currentPlacemarks).addToMap(map);
	}
	this.removeMark = function(proporties) {
		return ymaps.geoQuery(map.geoObjects).search(proporties).removeFromMap(map);
	}
	this.clearMap = function() {
		return map.geoObjects.removeAll();
	}
	this.destroyMap = function() {
		map.destroy();
		return null;
	}
	this.updateMapSize = function() {
		return map.container.fitToViewport();
	}
	this.setMapCenter = function(center) {
		return map.setCenter(center);
	}
	this.updateMarks = function(marksList) {
		this.clearMap();
		this.addMarksToMap(marksList);
	}

	return this;
}
// jquery ui
// range slider
function filterRange() {
	$('.filter__range').each(function(idx, el) {
		var minValue = $(el).data('min'),
			maxValue = $(el).data('max'),
			range = $(el).data('range'); // min or true
			
		if (range === true) {
			$(el).slider({
				range: true,
				min: minValue,
				max: maxValue,
				values: [ minValue, maxValue ],
				slide: function( event, ui ) {
					$(el).parent().find('.filter__price_min').val(Intl.NumberFormat().format(parseInt(ui.values[0])));
					$(el).parent().find('.filter__price_max').val(Intl.NumberFormat().format(parseInt(ui.values[1])));
				},
				create: function( event, ui ) {
					$(el).parent().find('.filter__price_min').val(Intl.NumberFormat().format(parseInt(minValue)));
					$(el).parent().find('.filter__price_max').val(Intl.NumberFormat().format(parseInt(maxValue)));
				}
			});
		} else {
			$(el).slider({
				range: range,
				min: minValue,
				max: maxValue,
				value: maxValue,
				slide: function( event, ui ) {
					// $(el).parent().find('.filter__price_min').val(Intl.NumberFormat().format(parseInt(minValue)));
					$(el).parent().find('.filter__price_max').val(Intl.NumberFormat().format(ui.value));
				},
				create: function( event, ui ) {
					$(el).parent().find('.filter__price_min').val(Intl.NumberFormat().format(parseInt(minValue)));
					$(el).parent().find('.filter__price_max').val(Intl.NumberFormat().format(parseInt(maxValue)));
				}
			});
		}
		
	})
}

function filterSpinner() {
	$.widget('ui.pref_spinner', $.ui.spinner, {
		_format: function(value) {
			if ($(this.element).hasClass('filter__spinner_min')) {
				return ' ' + value;
			} else {
				return ' ' + value;
			}
		},
		_parse: function(value) {
			var regexp = /\-?\d+/.exec(value)
			return  regexp ? parseInt(regexp[0]) : NaN;
		}
	});
	
	function format(value, input) {
		if (input.hasClass('filter__spinner_min')) {
			return ' ' + value;
		} else {
			return ' ' + value;
		}
	}
	
	function parse(value) {
		var regexp = /\-?\d+/.exec(value)

			console.log(regexp);
			
		
			return  regexp ? parseInt(regexp[0]) : 0;
	}
	
	$('.filter__spinner').each(function(idx, el) {
		$(el).pref_spinner({
			min: $(el).data('min'),
			max: $(el).data('max'),
			start: $(el).data('value'),
			icons: { down: "custom-down-icon", up: "custom-up-icon" },
		});
	});

	$('.filter__spinner').on('input', function() {
		var newValue = format(parse($(this).val()), $(this));
		
		$(this).val(newValue);
		
	});
}
