// collapse
function collapse() {
    var collapse = $('.collapse');

    collapse.each(function(idx, el) {
        var collapseItem = $(el).find('.collapse__item'),
            header = collapseItem.find('.collapse__header'),
            body = collapseItem.find('.collapse__body');

            header.on('click', function(e) {
                var _header = $(this),
                    _body = _header.closest('.collapse__item').find('.collapse__body');

	            _header.stop().toggleClass('active collapse_active');
	            header.not(_header).removeClass('active collapse_active');
	            _body.stop().slideToggle();
                body.not(_body).stop().slideUp();
            });
    });
}

// collapse_menu
function collapseMenu() {
    var collapse = $('.collapse_menu');

    collapse.each(function(idx, el) {
        var header = $(el).find('.collapse__header_menu'),
            body = $(el).find('.collapse__body_menu');

            header.on('click', function(e) {
                var _header = $(this),
                    _body = _header.closest('.collapse__item_menu').find('.collapse__body_menu');

	            $('.collapse_menu').find('.collapse__header_menu').not(_header).removeClass('active collapse_active');
	            _header.stop().toggleClass('active collapse_active');
	            $('.collapse_menu').find('.collapse__body_menu').not(_body).stop().slideUp();
	            _body.stop().slideToggle();
            });
    });
}

function findActiveParent() {
	var collapse = $('.collapse_menu');
	collapse.each(function(idx, el) {
			var activeEl = $(el).find('.special-menu__link_active')
		if (activeEl.length > 0){
			var activeBody = activeEl.closest('.collapse__body_menu')
			activeBody.stop().slideToggle();
			var activeHeader = $(el).find('.collapse__header_menu')
			activeHeader.stop().toggleClass('special-menu__link_active');
		}
	})
}

