function initCalendar() {
    var picker = $('#datepicker').datepicker({
        todayBtn: true,
        selectYears: false,
        minDate: -0,
        monthsToShow: 2,
        monthsToStep: 1,
        dateFormat: 'dd.mm.yy',
        useMouseWheel: false,
        changeMonth: false,
        changeYear: false,
        prevText: '',
        nextText: '',
        alignment: 'bottomLeft',
        showSpeed: 0,
        monthNames : ['','','','','','','','','','','',''],
        dayNamesMin : ['','','','','','',''],
    });
    $('.form__group_calendar_span').on('click', function(){
        $('#datepicker').datepicker('show');
    });
}

